css:
.git-status {
  padding: 0.5em 1em;
  max-height: 12.5em;
  overflow-y: auto;
}
.git-status-empty {
  font-size: 1.2em;
}
.git-status-item {
  margin: 0.35em 0;
}
.git-status-item:first-child {
  margin-top: 0;
}
.git-status-item:last-child {
  margin-bottom: 0;
}
.git-status-item:hover:not(.deleted) {
  text-decoration: underline;
  cursor: pointer;
}
.git-status-item.untracked {
  color: rgba(157, 165, 180, 0.6);
}
.git-status-item.added {
  color: #73c990;
}
.git-status-item.modified {
  color: #e2c08d;
}
.git-status-item.deleted {
  color: #ff6347;
}
